import React, { useState, useEffect } from "react";
import { View, Text, TouchableOpacity, Image } from "react-native";
import { SIZES } from "../constants";
import { COLORS } from "../constants";

const BajuAdat = ({ navigation }) => {
  return (
    <View
      style={{
        backgroundColor: COLORS.primary,
        flex: 1,
        alignContent: "center",
        alignItems: "center",
        justifyContent: "center",
      }}
    >
      <Text
        style={{
          color: "white",
          fontWheigt: 600,
          fontSize: 25,
          textAlign: "center",
          paddingHorizontal: 15,
        }}
      >
        Berikut beberapa sub materi yang bisa kamu baca
      </Text>
      <TouchableOpacity
        style={{
          backgroundColor: COLORS.secondary,
          paddingVertical: 12,
          paddingHorizontal: 12,
          borderRadius: 15,
          marginTop: 20,
        }}
        onPress={() => navigation.navigate("MateriSatu")}
      >
        <Text
          style={{
            color: "white",
            fontSize: 20,
          }}
        >
          Materi 1
        </Text>
      </TouchableOpacity>
      <Image
        source={require("../assets/images/DottedBG.png")}
        style={{
          width: SIZES.width,
          height: 130,
          zIndex: -1,
          position: "absolute",
          bottom: 0,
          left: 0,
          right: 0,
          opacity: 0.5,
        }}
        resizeMode={"contain"}
      />
    </View>
  );
};

export default BajuAdat;
